    //     console.log(e);
    //   });
    // }, [])
    console.log(data)


    return (
      <StyledCardsContainer>
        <HomePageHeader />
        <br />
        <br />
        <br />
        {data.length !== 0 
          ? data.map((job) => (
            <JobCardNew
              key = {job.ID}
              companyName={job.companyName}
              jobTitle={job.jobTitle}
              status={job.status}
            />
            )
          ) 
          : <NoJobs/> 
        }
      </StyledCardsContainer>
        )
      }
      return (<div>not authenticated</div>)
    }
